package medium_permutation_in_string

import "testing"

func Test_checkInclusion(t *testing.T) {
	type args struct {
		s1 string
		s2 string
	}
	tests := []struct {
		name string
		args args
		want bool
	}{
		{name: "Permutation #1", args: struct {
			s1 string
			s2 string
		}{s1: "ab", s2: "eidbaooo"}, want: true},
		{name: "Permutation #2", args: struct {
			s1 string
			s2 string
		}{s1: "ab", s2: "eidboaoo"}, want: false},
		{name: "Permutation #3", args: struct {
			s1 string
			s2 string
		}{s1: "a", s2: "ab"}, want: true},
		{name: "Permutation #4", args: struct {
			s1 string
			s2 string
		}{s1: "abc", s2: "bbbca"}, want: true},
		{name: "Permutation #5", args: struct {
			s1 string
			s2 string
		}{s1: "rvwrk", s2: "lznomzggwrvrkxecjaq"}, want: true},
		{name: "Permutation #6", args: struct {
			s1 string
			s2 string
		}{
			s1: "",
			s2: "",
		}, want: true},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := checkInclusion(tt.args.s1, tt.args.s2); got != tt.want {
				t.Errorf("checkInclusion() = %v, want %v", got, tt.want)
			}
		})
	}
}
